import UserLoginForm from "../pages/loginForm/loginForm";
import UserRegistrationForm from "../pages/userRegistrationForm/UserRegistrationForm";
import WorkSpace from "../pages/workSpace/WorkSpace";
import { LOGIN, REGISTRATION, WORK_SPACE } from "../utils/consts";
const path = require('path');

export const authRoutes = [
 { 
    path: WORK_SPACE,
    Component: WorkSpace
}
] //Странциы и информация доступная только авторизованным пользователям

export const publicRoutes = [
  {
    path: REGISTRATION,
    Component: UserRegistrationForm
  },

  {
    path: LOGIN,
    Component: UserLoginForm
  }

] //Страницы и ифнормация дотспная публично без авторизации
